import React, { PureComponent } from "react";
import {
  BarChart,
  Bar,
  Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ReferenceLine
} from "recharts";
import Card from "pnnl-react-core/lib/Card";

class LcsGraph extends PureComponent {
  constructor(props) {
    super(props);
    var lcs = this.props.data;

    this.data2 = [
      {
        name: "bin1",
